INSERT INTO `hackathon` VALUES (2,'AGS Transact Hackathon',NULL,'All the participants for the offline round, who had travelled from outside Mumbai and applied for their reimbursements by 5th of August, will receive their reimbursements latest by 31st August. Any reimbursement request received after 5th of August will not be entertained.\n\nPlease find the shortlisted teams for the On-site Hackathon Here\\\\n\\\\nAll Shortlisted Teams Please note: You will be getting an Email regarding the shortlist, please register for the same. Teams who do not fill the registration form before the deadline will not be considered for the On-site event\n\nAGS Transact Technologies Limited (AGSTTL) is one of India’s leading providers of end-to-end cash and digital payment solutions & automation technology, offering customized solutions serving the banking, retail, petroleum, and transit sectors. AGSTTL’s operations cover approximately 2,200 cities and towns, servicing approx. 2, 35,000 machines or customer touch points across India, as of June 30, 2018. The company has also started expanding its operations to Southeast Asian and other countries.\n\nFactors like PMJDY, UPI, AePS, rising smartphone penetration etc. have created favorable conditions for wider adoption of digital payments acceptance in India. In the past few years digital payments have grown multi-fold. Technological advancements in the Indian digital payment services ecosystem are providing fast transfers, convenience and faster check out options to Indian consumers. Today, there are many form factors available for making digital payments for end-consumers but the lack of merchant acceptance points is still a deterrent in non-metro cities. \n\n\nAs one of the leading providers of payment solutions in India, AGS Transact Technologies Limited aims to provide innovative & customized payment solutions to its customers; and facilitate an infrastructure which processes all the popular modes of transactions on a secured platform, which is scalable to support the newer payment technologies in the future','prkprime007@gmail.com','7218988627','https://www.agsindia.com/',_binary 'GIF89aF,\0\\\q`\e\k΄\\EBBm\\\]D8{I,\L\qR\T\nT4%\\popK(((Q0\{`bA3E(\\٣M,ӍZST%\\\\\}GǕn\h#ם]A4b\\\\Q\\R0ϊL111m \ė\u8˻\WL%ٸ\a#휄SB:וJA=x\YQ,WWWkWRjB0\Xk>}Q6\g\vڤésI3\\\x\T͔M0\zQ\[\"\|bE8yM8{8\iń\\\r+\a\ǟїH߯tTJGjI8\K\n\s)\\VsM81+(죙\{ϻk<%cI:\f\\}bZgD\l/\LŐ\elI4A1)IoE0kX4GIHJ\Iǃ\yc3[I<\ͼ\彂B]PN\`8!E#\żQ,Y\\\\\Ǿ\\%]SM9ˌ\\ﲩ\\\\\Ǌ]L3\\\\\\;uE,I&\aD\"zA#}I0yI0yE,\\\\lQ=0qE,\]M0M0\\\}E(}M4I,^R7ȪI0}E,ӖM,ӒyE(\ayE0M,I(yM0I(xM4\\iI,M,\u\qA,M4זn;\"}M0uE(I0yI4<:;``aI4N4E(גO8I5ONOuA(0,-q;UI0UM<,,,@@A!NETSCAPE2.0\0\0\0!XMP DataXMP<?xpacket begin=\"﻿\" id=\"W5M0MpCehiHzreSzNTczkc9d\"?> <x:xmpmeta xmlns:x=\"adobe:ns:meta/\" x:xmptk=\"Adobe XMP Core 5.6-c142 79.160924, 2017/07/13-01:06:39        \"> <rdf:RDF xmlns:rdf=\"http://www.w3.org/1999/02/22-rdf-syntax-ns#\"> <rdf:Description rdf:about=\"\" xmlns:xmp=\"http://ns.adobe.com/xap/1.0/\" xmlns:xmpMM=\"http://ns.adobe.com/xap/1.0/mm/\" xmlns:stRef=\"http://ns.adobe.com/xap/1.0/sType/ResourceRef#\" xmp:CreatorTool=\"Adobe Photoshop CC 2018 (Windows)\" xmpMM:InstanceID=\"xmp.iid:060FE2F8602C11E99DFC98B76767B4BF\" xmpMM:DocumentID=\"xmp.did:060FE2F9602C11E99DFC98B76767B4BF\"> <xmpMM:DerivedFrom stRef:instanceID=\"xmp.iid:060FE2F6602C11E99DFC98B76767B4BF\" stRef:documentID=\"xmp.did:060FE2F7602C11E99DFC98B76767B4BF\"/> </rdf:Description> </rdf:RDF> </x:xmpmeta> <?xpacket end=\"r\"?>\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\~}|{zyxwvutsrqponmlkjihgfedcba`_^]\\[ZYXWVUTSRQPONMLKJIHGFEDCBA@?>=<;:9876543210/.-,+*)(\'&%$#\"! \Z\r\n	\0\0!\0\0,\0\0\0\0F,\0\0\H*\\ȰÇ#JHŋ3j\ȱǏ:D(S\\ɲq0cʜI\\^8s挩	\nJ\!>;#G\\ʴӧPJJիK]j\ʵ\r`ÊKlYfӪ]˶۷p\\*ɤp-ʗH\'ɮL\Ƚ}+&(П\ǐ#KL\˘3k\̹\ϠCM\ӨS\|!CqcȊ[r\\]\\N\\8\ȓ+_>ICXM\֯a3\ν\\ËO\ŨWϤ}\cɟO\\Ͽ\0(\h\\\6\\F(!\Xabl0u \\ZL\\4gE\"2!\(?83\8\\<\\9ƀ`qH&dp\5\$rc<gT>\Zl\e\\\v9{