8\'\*iW\\B,\&3bEwPח\t]}4.w,\̆{qza2dbg\|nͣ{o᤿\a1$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$\{dl\0\0\0\0IENDB`','2019-04-18 20:00:00','2019-06-28 23:55:00'),(3,'\nMattermost Bot HackFest',NULL,'DevOps is transforming software development, engineering and operations across the world. Many DevOps workflows rely on real-time collaboration. Teams use messaging to increase efficiency during critical moments—provisioning infrastructure, merging code branches, or addressing urgent bugs. This form of collaboration is accelerated with ChatOps that brings disparate tools and workflows together and provides a shared console for easy collaboration, shorter feedback loops, and automated tasks.\n\nAt the center of ChatOps are bots. One of the most popular bots is Hubot, which allows developers to initiate commands to DevOps tools and take automated actions via custom scripts. Slack Bots have also become increasingly popular for team collaboration, ranging from DevOps tools to project management to fun bots that brighten your day.\n\nThe goal of this hackathon is to create bots that bring ChatOps to the heart of the leading open source DevOps platform, Mattermost. You have the opportunity to create an open source bot that is used by millions of people from small teams to large enterprises, and make a lasting impact on the DevOps community. Together, let’s create something amazing!','prkprime007@gmail.com','7218988627','https://mattermost.com/',NULL,NULL,'2020-01-10 21:30:00','2020-02-07 21:30:00'),(4,'NEC Hackathon',NULL,'90% of the schools are located in rural area. Statistical records from extensive surveys have shown that rural education in India has developed to some extent, however there are still many issues/challenges that we need to tackle to enable the growth of education in the countryside.\n\nLack of proper transportation to school, basic infrastructure, qualified teachers, quality of education, low awareness of importance of education, etc are just small portion of challenges which holds back the development.\n\nExamination monitoring & proctoring.\n\nLack of localisation of content due to which students are unable to understand.\n\nLack of standardised Assessment Methods.\n\nNEC is looking for innovative solutions to tackle these challenges and improve education in rural areas.','07rritz@gmail.com','7066016461','https://in.nec.com',NULL,NULL,'2020-03-01 09:00:00','2020-04-01 09:00:00'),(5,'Airport NextGen',NULL,'Required Participants to provide innovative ideas for future arirport.','07rritz@gmail.com','7088016461','https://aimlcommunity.com/hackathon_events/airport-nextgen-hackathon-2019-20',NULL,NULL,'2020-05-01 12:30:00','2020-06-10 12:30:00'),(6,'NEC Hackathon: Food',NULL,'Food wastage is a universal issue. According to a report by the Food and Agricultural Organisation of the United Nations, 40% of the food produced in India is either lost or wasted. The food wastage however isn’t limited to one level alone but perforates through every stage; from harvesting, processing, packaging and transporting to the end stage of consumption. Weddings, events, restaurants, hostels and houses are also the major source for food wastage.\n\nIf this food waste continues, it will create the huge impact on environment. All the resources which are required to bring food from the farm to table such as water for irrigation, land for planting, fuel for powering harvest and transport vehicles are also affected. In order to solve the pain-point of food wastage and encourage the sustainable lifestyle in India, we believe that emerging technologies will bring the intelligent and innovative solutions to food waste.\n\nLet’s develop sustainable food solution and turns India’s food waste problem into opportunity!','07rritz@gmail.com','7066016416','https://in.nec.com',NULL,NULL,'2020-07-25 17:00:00','2020-07-30 17:00:00'),(7,'HCL AI Hackathon',NULL,'acking is building things that you always wanted to have but no one has built it yet. It\'s to come up with an amazing idea and work tirelessly on it. It is to fail, fail again and fail better. Try out new things and learn while doing that. It\'s to work together, collaborate and build things that are innovative. It is to be a better programmer.\n\nWith that spirit, HackerEarth is conducting a hackathon - HCL Lucknow AI Hackathon and invites all developers and hackathon enthusiasts to participate in an interesting and engaging hackathon.','prkprime007@gmail.com','7218988627','https://www.hcltech.com/',NULL,NULL,'2020-01-17 09:30:00','2020-02-17 09:30:00'),(8,'Hack for TRAI',NULL,'This hackathon has been aimed at looking at the various technological options and finalising the optimal solution to capture the TV viewership data without/with least human interventions, and transferring it to a server over a secure network, without compromising the privacy and secrecy.','prkprime007@gmail.com','7218988627','https://www.hcltech.com/',NULL,NULL,'2020-04-10 12:00:00','2020-05-09 12:00:00');
